                    content: [{
                        title: "VFS Global wins the Golden Peacock National Training Award for the third time since 2017",
                        date: "05 July 2022",
                        desc: "VFS Global has won the Golden Peacock National Training Award for 2022 in recognition of the organisations exemplary learning and development practices, particularly duing the pandemic. Golden Peacock Awards, instituted by the Institute of Directors (IOD), India in 1991, are regarded as a benchmark of Corporate Excellence globally. In 2022, more than 260 corporates contested across four award categories - Innovation, Business Excellence, Quality Management and Learning & Development.<br>During the pandemic, 215 training courses were offered virtually through our Learn From Home Programme in 2020, registering a staggering 111,000+ participant logins. More than 80% of the global workforce attended at least one training programme in 2021 clocking 2.9 average person-days of training.",
                        show_on_latest: !0,
                        show_on_home: !0
                    }, {
                        title: "VFS Global wins the Dubai Quality Appreciation Award for excellence in the service sector",
                        date: "28 March 2022",
                        desc: "VFS Global has received the prestigious Dubai Quality Appreciation Award (DQAA) in the Services category for 2021 at Dubais Department of Economy and Tourism (DET)s 28th Business Excellence Awards. VFS Global was assessed as a winner based on the RADAR Assessment Excellence Model used by the European Foundation for Quality Management (EFQM) and management evaluation method, which evaluates each company on nine criteria  viz. Leadership, Strategy, People, Partnership & Resources, Processes, Products & Services, People Results, Customer Results, Society Results and Business Results.",
                        show_on_latest: !0
                    }]
